"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[4728],{56664:(a,t,i)=>{i.r(t),i.d(t,{default:()=>n,johnChapter19SW:()=>e});const e={chapter:19,title:"Jean 19",version:"Swahili Union Version",language:"sw",direction:"ltr",verses:[{number:1,text:"Pilato basi alimchukua Yesu, akampiga viboko.",strong:[]},{number:2,text:"Na askari wakasokotwisha taji ya miiba, wakamvika kichwani, wakamvika joho la zambarau;",strong:[]},{number:3,text:"wakasema, Shikamoo, Mfalme wa Wayahudi! nao wakampiga makofi.",strong:[]},{number:4,text:"Pilato akatoka tena nje, akawaambia, Tazama, ninamleta kwenu nje, ili mpate kujua ya kuwa sipati hatia yo yote ndani yake.",strong:[{text:"nouveau",strong:"G2537",start:17,end:24},{text:"aucun",strong:"G3762",start:121,end:126}]},{number:5,text:"Yesu basi akatoka nje, akiwa amevaa ile taji ya miiba na lile joho la zambarau. Pilato akawaambia, Tazama, mtu huyu!",strong:[{text:"homme",strong:"G444",start:102,end:107}]},{number:6,text:"Basi makuhani wakuu na maakida walipomwona, wakapiga kelele, wakisema, Msulibishe, msulibishe! Pilato akawaambia, Mchukueni ninyi mwenyewe, mkamsulibishe; maana mimi sipati hatia ndani yake.",strong:[]},{number:7,text:"Wayahudi wakamjibu, Sisi tunayo sheria, na kwa mujibu wa sheria yetu anastahili kufa, kwa sababu amejifanya Mwana wa Mungu.",strong:[{text:"selon",strong:"G2531",start:51,end:56},{text:"Fils",strong:"G5207",start:107,end:111},{text:"Dieu",strong:"G2316",start:115,end:119}]},{number:8,text:"Pilato basi aliposikia neno hili, aliogopa zaidi;",strong:[{text:"cette",strong:"G3778",start:22,end:27},{text:"parole",strong:"G3056",start:28,end:34}]},{number:9,text:"akaingia tena ndani ya jumba la baraza, akamwambia Yesu, Wewe u wa wapi? Lakini Yesu hakumpa jibu.",strong:[{text:"dans",strong:"H6887",start:10,end:14}]},{number:10,text:"Pilato basi akamwambia, Je, hukuneni mimi? Hujui kwamba nina mamlaka ya kukufungulia, na kwamba nina mamlaka ya kukusulibu?",strong:[{text:"cher",strong:"G27",start:136,end:140}]},{number:11,text:"Yesu akajibu, Hukuwa na mamlaka yo yote juu yangu, kama usingelikuwa umepewa toka juu; kwa sababu hiyo yeye aliyenikabidhi kwako, ana dhambi kubwa.",strong:[{text:"aucun",strong:"G3762",start:36,end:41},{text:"grand",strong:"G3173",start:143,end:148}]},{number:12,text:"Tangu wakati huo Pilato alijitahidi kumfungulia; lakini Wayahudi wakapiga kelele, wakisema, Ukimfungulia huyu, wewe si rafiki wa Kaisari; kila ajifanyaye mfalme humwasi Kaisari.",strong:[{text:"cher",strong:"G27",start:41,end:45},{text:"contre",strong:"G2596",start:150,end:156}]},{number:13,text:"Pilato basi aliposikia maneno hayo, akamleta Yesu nje, akakaa kitini mwa hukumu mahali paitwapo Risasi, bali kwa Kiebrania Gabatha.",strong:[]},{number:14,text:"Ilikuwa ni siku ya maandalio ya Pasaka, yapata saa sita. Akawaambia Wayahudi, Tazama, Mfalme wenu!",strong:[]},{number:15,text:"Basi wakapiga kelele, Mwondoe, mwondoe, msulibishe! Pilato akawaambia, Nikamsulibu Mfalme wenu? Makuhani wakuu wakajibu, Hatuna mfalme, isipokuwa Kaisari.",strong:[]},{number:16,text:"Hapo akamkabidhi kwao, ili asulubiwe. Basi wakamchukua Yesu, wakamwongoza.",strong:[]},{number:17,text:"Naye akibeba msalaba wake mwenyewe, akatoka, akaenda mahali paitwapo Fuvu la Kichwa, papitwapo kwa Kiebrania Golgotha;",strong:[]},{number:18,text:"mahali hapo wakamsulibu, pamoja na wengine wawili, upande mmoja na upande mwingine, naye Yesu katikati.",strong:[{text:"deux",strong:"G1417",start:32,end:36},{text:"avec",strong:"G1848",start:44,end:48},{text:"chaque",strong:"G3956",start:60,end:66}]},{number:19,text:"Pilato akaandika nao chelezo, akalitia juu ya msalaba. Na liliandikwa, YESU WA NAZARETI, MFALME WA WAYAHUDI.",strong:[]},{number:20,text:"Chelezo hili basi Wayahudi wengi walisoma; kwa kuwa mahali pale Yesu aliposulubiwa palikuwa karibu na mji; nalo liliandikwa kwa Kiebrania, kwa Kirumi, kwa Kiyunani.",strong:[{text:"Beaucoup",strong:"G4183",start:0,end:8},{text:"cette",strong:"G3778",start:25,end:30},{text:"grec",strong:"G1672",start:133,end:137}]},{number:21,text:"Basi makuhani wakuu wa Wayahudi wakamwambia Pilato, Usiandike, Mfalme wa Wayahudi; bali ya kuwa yeye alisema, Mimi ni Mfalme wa Wayahudi.",strong:[]},{number:22,text:"Pilato akajibu, Nililoandika nimeandika.",strong:[]},{number:23,text:"Askari basi, walipokwisha kumsulibu Yesu, wakavichukua vile mavazi vyake, wakavigawa sehemu nne, kila askari sehemu moja, pamoja na ile kanzu; bali kanzu ilikuwa bila mshono, ikiwemo kufumwa juu.",strong:[{text:"avoir",strong:"G1372",start:19,end:24},{text:"chaque",strong:"G3956",start:109,end:115},{text:"seul",strong:"G3439",start:183,end:187}]},{number:24,text:"Basi wakasemezana, Tusiirarue, bali tuipige kura, iwe ya nani; ili liletimie lile andiko linasema, Waligawana mavazi yangu, na wakafanya kura ya kunijia kanzu yangu. Mambo haya basi askari wakayafanya.",strong:[{text:"cette",strong:"G3778",start:116,end:121},{text:"parole",strong:"G3056",start:122,end:128}]},{number:25,text:"Na mama yake Yesu alikuwa amesimama karibu na ule msalaba, na dada wa mama yake, Mariamu mke wa Kleopa, na Mariamu Magdalena.",strong:[]},{number:26,text:"Yesu basi alipomwona mama yake, na yule mwanafunzi aliyempenda amesimama karibu, akamwambia mama yake, Mama, tazama, mwanao!",strong:[{text:"disciple",strong:"G3101",start:43,end:51},{text:"fils",strong:"G5207",start:98,end:102}]},{number:27,text:"Kisha akamwambia yule mwanafunzi, Tazama, mama yako! Na tangu saa ile yule mwanafunzi akamchukua nyumbani kwake mwenyewe.",strong:[{text:"disciple",strong:"G3101",start:15,end:23},{text:"disciple",strong:"G3101",start:62,end:70}]},{number:28,text:"Baada ya hayo, Yesu akijua ya kuwa mambo yote yamekwisha kutimia, ili maandiko yatimie, akasema, Ninaona kiu.",strong:[{text:"tout",strong:"G3956",start:34,end:38},{text:"soif",strong:"G1372",start:105,end:109}]},{number:29,text:"Ikiwa hapo chombo kimejaa siki. Basi wakalowanisha siki kiunzi cha hisopo, wakauvika mwanzoni mwa mwanzi, wakautia kwenye kinywa chake.",strong:[]},{number:30,text:"Yesu basi alipoisha kupokea siki, akasema, Imekwisha kutimia; akainamisha kichwa chake, akatoa roho.",strong:[{text:"Tout",strong:"G3956",start:42,end:46},{text:"esprit",strong:"G4151",start:95,end:101}]},{number:31,text:"Basi Wayahudi, kwa kuwa ilikuwa ni siku ya maandalio, ili mizoga isibaki juu ya msalaba Sabato (maana siku ile ya Sabato ilikuwa kuu), wakamwomba Pilato kwamba miguu yao ivunjwe, waondolewe.",strong:[{text:"Dans",strong:"H6887",start:0,end:4},{text:"corps",strong:"G4561",start:24,end:29},{text:"jour",strong:"H3117",start:111,end:115},{text:"grand",strong:"G3173",start:135,end:140},{text:"jour",strong:"H3117",start:141,end:145}]},{number:32,text:"Askari basi wakaja, wakamvunja miguu yule wa kwanza, na yule mwingine aliyesulubiwa pamoja naye;",strong:[{text:"premier",strong:"G4413",start:57,end:64},{text:"avec",strong:"G1848",start:104,end:108}]},{number:33,text:"lakini walipomjia Yesu, na kumwona kuwa amekwisha kufa, hawakumvunja miguu;",strong:[{text:"mort",strong:"H6757",start:46,end:50}]},{number:34,text:"lakini mmoja wa askari akamchoma ubavuni mwake kwa mkuki, na mara damu na maji vikatoka.",strong:[{text:"avec",strong:"G1848",start:38,end:42}]},{number:35,text:"Naye aliyeona ametoa ushuhuda, na ushuhuda wake ni wa kweli; naye anajua ya kuwa asema kweli, ili ninyi mpate kuamini.",strong:[]},{number:36,text:"Maana mambo haya yalitokea, ili litimie lile andiko, Mfupa wake hautavunjwa.",strong:[{text:"Aucun",strong:"G3762",start:61,end:66}]},{number:37,text:"Na tena andiko lingine lasema, Watamtazama yeye waliyemchoma.",strong:[]},{number:38,text:"Baada ya mambo haya, Yusufu wa Arimathaya, akiwa mwanafunzi wa Yesu, lakini kwa siri, kwa kuwaogopa Wayahudi, akamwomba Pilato aondoe mwili wa Yesu; na Pilato akamruhusu. Kwa hiyo akaja, akauondoa mwili wake.",strong:[{text:"disciple",strong:"G3101",start:42,end:50},{text:"prendre",strong:"G3880",start:133,end:140},{text:"corps",strong:"G4561",start:144,end:149},{text:"corps",strong:"G4561",start:206,end:211}]},{number:39,text:"Nikodemo naye, yeye aliyekuja kwa Yesu usiku wa kwanza, akaja, akiwa amechukua mchanganyiko wa manemane na udi, yapatao ratili mia.",strong:[{text:"nuit",strong:"G3571",start:39,end:43}]},{number:40,text:"Basi wakautwaa mwili wa Yesu, wakaufunga kwa vitambaa pamoja na vile vikolezo, kama ilivyo desturi ya Wayahudi kuzikia.",strong:[{text:"corps",strong:"G4561",start:20,end:25},{text:"avec",strong:"G1848",start:66,end:70},{text:"comme",strong:"G2531",start:85,end:90}]},{number:41,text:"Mahali pale aliposulubiwa palikuwa na bustani, na katika bustani kaburi jipya, ambalo mtu hakuwa amewekwa ndani yake kamwe.",strong:[{text:"dans",strong:"H6887",start:25,end:29},{text:"dans",strong:"H6887",start:70,end:74},{text:"personne",strong:"G3762",start:106,end:114}]},{number:42,text:"Hapo basi wakamweka Yesu, kwa sababu ya siku ya maandalio ya Wayahudi; kwa kuwa kaburi lilikuwa karibu.",strong:[]}]},n=e}}]);
//# sourceMappingURL=john-john-19-sw-js.5419aa11.chunk.js.map